{
  "version": "0.2",
  "phases": {
    "install": {
      "commands": [
        "chmod +x ./tools/*.sh",
        "./tools/setup-aws-environment.sh",
        "./tools/install-nodejs-14.sh",
        "yarn --frozen-lockfile",
        "npm install -g @aws-amplify/cli cowsay",
        "git clone https://github.com/flutter/flutter.git -b stable --depth 1 /tmp/flutter",
        "export PATH=$PATH:/tmp/flutter/bin",
        "flutter doctor",
        "npx cowsay \"STARTING PR CHECK\""
      ]
    },
    "build": {
      "commands": [
        "./tools/build-workspace.sh anyupp-backend dev",
        "yarn nx affected:lint --base=dev --exclude=shared-config --exclude=anyupp-gql-api --exclude=crud-gql-api",
        "yarn nx affected:test --base=dev --exclude=\"anyupp-mobile\" --exclude=\"integration-tests-angular\" --exclude=\"integration-tests-universal\" --exclude=shared-config --exclude=anyupp-gql-api --exclude=crud-gql-api --codeCoverage --coverageReporters=clover",
        "yarn nx buildApk anyupp-mobile",
        "npx cowsay \"YOUR PR IS SUPERCOOL!!!\""
      ]
    }
  },
  "env": {
    "secrets-manager": {
      "AWS_ACCESS_KEY_ID": "codebuild:codebuild-aws_access_key_id",
      "AWS_SECRET_ACCESS_KEY": "codebuild:codebuild-aws_secret_access_key"
    },
    "variables": {
      "NODE_OPTIONS": "--unhandled-rejections=strict --max_old_space_size=8196"
    }
  }
}

{
  "version": "0.2",
  "phases": {
    "install": {
      "commands": [
        "chmod +x ./tools/*.sh",
        "./tools/setup-aws-environment.sh",
        "./tools/install-nodejs-14.sh",
        "yarn --frozen-lockfile",
        "npm install -g @aws-amplify/cli appcenter-cli"
      ]
    },
    "build": {
      "commands": [
        "./tools/build-workspace.sh anyupp-backend staging",
        "git clone https://github.com/flutter/flutter.git -b stable --depth 1 /tmp/flutter",
        "yarn nx deploy crud-backend",
        "yarn nx deploy anyupp-backend --stage=staging --app=anyupp-backend",
        "export PATH=$PATH:/tmp/flutter/bin",
        "flutter doctor",
        "yarn nx buildApk anyupp-mobile"
      ]
    },
    "post_build": {
      "commands": [
        "tar -cvf ${CODEBUILD_RESOLVED_SOURCE_VERSION}.tgz apps/anyupp-mobile/lib/awsconfiguration.dart",
        "aws s3 cp ${CODEBUILD_RESOLVED_SOURCE_VERSION}.tgz s3://anyupp-build-artifacts-staging/",
        "echo 'Pushing Android APK to appcenter'",
        "./tools/publish-to-appcenter.sh staging android",
        "echo 'Triggering ios app build in appcenter...'",
        "./tools/trigger-appcenter-builds.sh staging ios"
      ]
    }
  },
  "artifacts": {
    "files": [
      "apps/anyupp-backend/cdk.out/**/*"
    ]
  },
  "env": {
    "secrets-manager": {
      "AWS_ACCESS_KEY_ID": "codebuild:codebuild-aws_access_key_id",
      "AWS_SECRET_ACCESS_KEY": "codebuild:codebuild-aws_secret_access_key",
      "APP_CENTER_TOKEN": "codebuild:codebuild-appcenter-token"
    },
    "variables": {
      "NODE_OPTIONS": "--unhandled-rejections=strict --max_old_space_size=8196"
    }
  }
}
